import React, { Component } from "react";
import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { robots } from "./robots";

class App extends Component {
    constructor() {
        super()
        this.state = {
            robots: robots,
            searchfiled: ''
        }
    }
    render(){
        return (
            <div className="tc">
                <h1>Robot Friends</h1>
                <SearchBox />
                <CardList robots={robots} />
            </div>
        );
    }
}

export default App;
